#include <iostream>
#include <vector>
#include <algorithm>

using namespace std;

int main()
{
    int n;
    cin >> n;
    vector<int> a(n, 0);
    vector<int> t(n, 0);
    for (int i = 0; i < n; i++)
    {
        cin >> a[i];
    }
    for (int i = 0; i < n; i++)
    {
        cin >> t[i];
    }
    sort(a.begin(), a.end());
    sort(t.begin(), t.end());
    int sum = 0;
    for (int i = 0; i < n; i++)
    {
        sum += a[i] * t[i];
    }
    cout << sum << endl;
    return 0;
}
